        e.preventDefault();
    }
    return(
        <div>
            <form method="post" onSubmit={(e)=>{handleSubmit(e)}}>
                <input type="text" placeholder="Search" value={search} onChange={(e)}/>
                <input type="submit" value="Search"/>
            </form>
        </div>
    )
}
